import React from 'react'
import { FaStar } from 'react-icons/fa';

function Starrating() {
    return (
        <div>
            {[...Array(5)].map((star, i) => {
                const ratingValue = i + 1;

                return (
                    <label>
                        <input type="radio" name="rating" value={ratingValue} />
                        <FaStar size={20} />
                    </label>
                )
            })}
        </div>
    )
}

export default Starrating
